=head1 DESCRIPTION

An error corresponding to the unsuccessful processing of a single
metric data query.

=head1 ATTRIBUTES


=head2 Code => Str

The query error code. Can be one of:

=over

=item *

C<INTERNAL_FAILURE> E<ndash> Amazon SES has failed to process one of
the queries.

=item *

C<ACCESS_DENIED> E<ndash> You have insufficient access to retrieve
metrics based on the given query.

=back



=head2 Id => Str

The query identifier.


